import React from 'react'

const Emp_Table = ({ data }) => {
    return (
      <table>
        <thead className="bg-gray-200">
          <tr>
            <th className="border px-4 py-2 text-left text-gray-700" ></th>
            <th className="border px-4 py-2 text-left text-gray-700" >ID</th>
            <th className="border px-4 py-2 text-left text-gray-700" >Name</th>
            <th className="border px-4 py-2 text-left text-gray-700">Age</th>
          </tr>
        </thead>
        <tbody>
          {data.map((row) => (
            <tr key={row.id} className="even:bg-gray-100">
              <td className="border px-4 py-2 text-gray-600">{row.id}</td>
              <td className="border px-4 py-2 text-gray-600">{row.name}</td>
              <td className="border px-4 py-2 text-gray-600">{row.age}</td>
            </tr>
          ))}
        </tbody>
      </table>
    );
  };

export default Emp_Table
